(15, 'TRUNG THU - FULL MOON EVENT', '<p>TRUNG THU -FULL MOON event<br />\r\nVới mỗi h&oacute;a đơn 500.000, TẶNG NGAY 100.000 khi mua 1 sản phẩm tiếp theo.</p>\r\n\r\n<p>&Aacute;p dụng tại tất cả c&aacute;c cửa h&agrave;ng khu vực Hồ Ch&iacute; Minh.&nbsp;</p>\r\n\r\n<p>Thời gian: Từ ng&agrave;y 22- 24/09/2018.<br />\r\n---------------------------------------------<br />\r\nLưu &yacute;:<br />\r\n-Kh&ocirc;ng &aacute;p dụng bất kỳ chế độ ưu đ&atilde;i n&agrave;o kh&aacute;c.<br />\r\n-Sản phẩm giảm gi&aacute; đ&atilde; mua kh&ocirc;ng &aacute;p dụng h&igrave;nh thức đổi trả.<br />\r\n-Mỗi 100.000 được tặng chỉ &aacute;p dụng cho 1 sản phẩm<br />\r\n-Gi&aacute; trị tặng 100.000 kh&ocirc;ng được quy đổi th&agrave;nh tiền mặt</p>\r\n\r\n<p><img alt=\"\" src=\"http://admocmgo2o.limeorange.vn/uploads/board/2018933328_editor_image.jpg\" /></p>\r\n', '2018-10-02 06:22:53');
